import React, { useState } from 'react';
import logo from './assets/logo.svg';

import artistStatement from './assets/artists-statement.png';
import atoll from './assets/atoll.jpg';
import atollCharcoal from './assets/atoll-charcoal.jpg';
import bathroom from './assets/bathroom.jpg';
import blueprint from './assets/blueprint.jpg';
import blueprintFront from './assets/blueprint-front-facing.jpg';
import downTheDrain from './assets/down-the-drain.jpg';
import dragonMap from './assets/dragon-map.jpg';
import exhibition from './assets/exhibition.jpg';
import exhibitionPoster from './assets/exhibition-poster.png';
import familyDinner from './assets/family-dinner.jpg';
import ferrisWheel from './assets/ferris-wheel.jpg';
import flowerPeople from './assets/flower-people.jpg';
import generations from './assets/generations.jpg';
import glassWater from './assets/glass-and-water.jpg';
import home from './assets/home.jpg';
import hongKong from './assets/hong-kong.jpg';
import kitchenTable from './assets/banks-street-kitchen-table.jpg'
import kitchenShelves from './assets/banks-street-kitchen-shelves.jpg'
import kittyLove from './assets/kitty-love.jpg'
import lessOfAStrangerBlack from './assets/less-of-a-stranger-black.jpg'
import lessOfAStrangerGold from './assets/less-of-a-stranger-gold.jpg'
import mindPalace from './assets/mind-palace.jpg';
import redacted from './assets/redacted.jpg'
import threeWiseFools from './assets/three-wise-fools.jpg';
import waterTiles from './assets/water-tiles.jpg'
import './App.css';

function Image({ src, color, name, medium, year }) {
    const [isOpen, setIsOpen] = useState(false)
    return (
      <>
        <div className='galleryItem'>
          <img onClick={() => setIsOpen(true)} src={src} className={`defaultPhoto photo${color}`} />
        </div>
        {isOpen && (
          <div onClick={() => setIsOpen(false)} className={`modal  modal${color}`}>
            <div className='imgContainer'>
              <img src={src} className={`modalPhoto`} />
              <div className='label'>
                <span><i>{name}</i></span>
                <span><i>{medium}</i></span>
                <span><i>{year}</i></span>
              </div>
            </div>
          </div>
        )}
      </>
    )
}

function App() {
  const prints = [
    [redacted, 'Green', 'Redacted', 'screenprint on paper', '2022'],
    [generations, 'Red', 'Generations', 'screenprint on paper', '2022'],
    [downTheDrain, 'Green', 'Down the drain', 'linocut on paper', '2024'],
    [threeWiseFools, 'Blue', 'Three wise fools', 'collage with screenprints and linocuts', '2022'],
    [kitchenShelves, 'Green', 'Banks Street kitchen - shelves', 'lithograph on paper', '2023'],
    [waterTiles, 'Blue', 'Water tiles', 'screenprint on paper', '2022'],
    [hongKong, 'Blue', 'Hong Kong map', 'lithograph and screenprint on paper', '2023'],
    [kitchenTable, 'Green', 'Banks Street kitchen - table', 'lithograph on paper', '2023'],
    [kittyLove, 'Blue', 'Love', 'lithograph on paper', '2023'],
    [lessOfAStrangerBlack, 'Red', 'Less of a stranger (black)', 'linocut on paper', '2023'],
    [lessOfAStrangerGold, 'Red', 'Less of a stranger (gold)', 'linocut on paper', '2023'],
  ]

  const paintings = [
    [glassWater, 'Red', 'Glass and water', 'acrylic on canvas', '2024'],
    [home, 'Green', 'Home', 'oil on canvas', '2021'],
    [atoll, 'Red', 'Atoll', 'acrylic on paper', '2022'],
    [flowerPeople, 'Red', 'Flower people', 'acrylic and wire on paper', '2021'],
    [bathroom, 'Red', 'Bathroom', 'gouache on paper', '2021'],
    [ferrisWheel, 'Blue', 'Ferris wheel', 'oil on canvas', '2021'],
    [familyDinner, 'Blue', 'Family dinner', 'oil on canvas', '2021'],
    [mindPalace, 'Green', 'Mind palace', 'oil on canvas', '2021'],
  ]

  const homeComingExhibition = [
    [exhibitionPoster, 'Green', 'Exhibition poster'],
    [artistStatement, 'Green', "Artist's statement"],
    [exhibition, 'Blue', "Exhibition room"],
    [dragonMap, 'Red', 'Dragon map', 'embroidery on canvas bag', '2022'],
    [redacted, 'Green', 'Redacted', 'screenprint on paper', '2022'],
    [atoll, 'Red', 'Atoll', 'acrylic on paper', '2022'],
    [atollCharcoal, 'Red', 'Atoll', 'charcoal on paper', '2022'],
    [blueprint, 'Green', 'Blueprint', 'paper stencil', '2023'],
    [blueprintFront, 'Green', 'Blueprint', 'paper stencil', '2023'],
  ]

  const sections = [
    [prints, "PRINTS"],
    [paintings, "PAINTINGS"],
    [homeComingExhibition, "HOME COMING EXHIBITION"]
  ]

  return (
    <div className="app">
      <div className="headerContainer">
        <img src={logo} className="logo"/>
        <div className="header">
          <span className="bio">
            Eva Lau is an (avid, active, etc) artist and (occasional) programmer in nyc.
          </span>
          <i> (Mainly, however, she seems to just enjoy making things that make her happy.)</i>
        </div>
      </div>
      <div>
       <p className="warning">this site is under construction, but it welcomes all visitors :)</p>
      </div>
      <div>
        {sections.map(([section, title]) => (
          <div className='section'>
            <span className='sectionTitle'>{title}</span>  
            <div className='gallery'>
              {section.map(([src,color,pieceName,medium,year]) => (
                <Image src={src} color={color} name={pieceName} medium={medium} year={year}/>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
